create or replace table targyak (
	id number primary key,
	kod varchar(100) not null,
	nev varchar(1000) not null
);

create or replace table termek (
	id number primary key,
	terem varchar(100) not null
);

create or replace table kurzusok (
	id number primary key,
	targy_id number not null,
	oktato varchar(100),
	nap varchar(20),
	idopont_tol varchar(20),
	idopont_ig varchar(20),
	terem_id number not null,
	oratipus varchar(20),
	csoport number
);




